"use strict";(self.webpackChunkmy_website=self.webpackChunkmy_website||[]).push([[53],{1109:t=>{t.exports=JSON.parse('{"pluginId":"default","version":"current","label":"Next","banner":null,"badge":false,"noIndex":false,"className":"docs-version-current","isLast":true,"docsSidebars":{"tutorialSidebar":[{"type":"link","label":"Introduction","href":"/Surf-Docs/docs/intro","docId":"intro"},{"type":"category","label":"Getting Started","collapsible":true,"collapsed":true,"items":[{"type":"link","label":"Creating Your Account","href":"/Surf-Docs/docs/Getting Started/Creating Your Account","docId":"Getting Started/Creating Your Account"},{"type":"link","label":"Email Verification","href":"/Surf-Docs/docs/Getting Started/Email Verification","docId":"Getting Started/Email Verification"},{"type":"link","label":"Date of Birth Policy","href":"/Surf-Docs/docs/Getting Started/date of birth","docId":"Getting Started/date of birth"},{"type":"link","label":"Create your Profile","href":"/Surf-Docs/docs/Getting Started/Create Profile","docId":"Getting Started/Create Profile"},{"type":"link","label":"Pin Creation","href":"/Surf-Docs/docs/Getting Started/Pin","docId":"Getting Started/Pin"},{"type":"link","label":"Congrats!","href":"/Surf-Docs/docs/Getting Started/Congrats","docId":"Getting Started/Congrats"}],"href":"/Surf-Docs/docs/category/getting-started"},{"type":"category","label":"Posts","collapsible":true,"collapsed":true,"items":[{"type":"link","label":"What is a Post?","href":"/Surf-Docs/docs/Posts/What is a post","docId":"Posts/What is a post"},{"type":"link","label":"Creating a post","href":"/Surf-Docs/docs/Posts/Creating a Post","docId":"Posts/Creating a Post"},{"type":"link","label":"Comments","href":"/Surf-Docs/docs/Posts/Post Comments","docId":"Posts/Post Comments"},{"type":"link","label":"Post Components","href":"/Surf-Docs/docs/Posts/Post Components","docId":"Posts/Post Components"}],"href":"/Surf-Docs/docs/category/posts"},{"type":"category","label":"Threads","collapsible":true,"collapsed":true,"items":[{"type":"link","label":"What is a Thread?","href":"/Surf-Docs/docs/Threads/What is a Thread","docId":"Threads/What is a Thread"},{"type":"link","label":"Creating a Thread","href":"/Surf-Docs/docs/Threads/Creating a Thread","docId":"Threads/Creating a Thread"},{"type":"link","label":"Comments","href":"/Surf-Docs/docs/Threads/Thread Comments","docId":"Threads/Thread Comments"},{"type":"link","label":"Thread Components","href":"/Surf-Docs/docs/Threads/Post Components","docId":"Threads/Post Components"}],"href":"/Surf-Docs/docs/category/threads"},{"type":"category","label":"Notifications","collapsible":true,"collapsed":true,"items":[{"type":"link","label":"Notification Types","href":"/Surf-Docs/docs/Notifications/Notification Types","docId":"Notifications/Notification Types"},{"type":"link","label":"Silent Mode","href":"/Surf-Docs/docs/Notifications/Silent Mode","docId":"Notifications/Silent Mode"},{"type":"link","label":"Notifications Page","href":"/Surf-Docs/docs/Notifications/Notifications Page","docId":"Notifications/Notifications Page"}],"href":"/Surf-Docs/docs/category/notifications"},{"type":"category","label":"Surf Chat","collapsible":true,"collapsed":true,"items":[{"type":"link","label":"Surf Chat","href":"/Surf-Docs/docs/Chat/What is Chat","docId":"Chat/What is Chat"},{"type":"link","label":"Create a Chat","href":"/Surf-Docs/docs/Chat/Create a chat","docId":"Chat/Create a chat"},{"type":"link","label":"Encryption","href":"/Surf-Docs/docs/Chat/Encryption","docId":"Chat/Encryption"},{"type":"link","label":"Chats","href":"/Surf-Docs/docs/Chat/Chats","docId":"Chat/Chats"}],"href":"/Surf-Docs/docs/category/surf-chat"},{"type":"link","label":"Surf Enterprise","href":"/Surf-Docs/docs/Enterprise","docId":"Enterprise"},{"type":"link","label":"Surf Sapphire","href":"/Surf-Docs/docs/Surf Sapphire","docId":"Surf Sapphire"}]},"docs":{"Chat/Chats":{"id":"Chat/Chats","title":"Chats","description":"When you\'re in a chat, you will see the messages of the other user on the left, while your own will be on the right. They will also have the time at which you posted them.","sidebar":"tutorialSidebar"},"Chat/Create a chat":{"id":"Chat/Create a chat","title":"Create a Chat","description":"In order to create a Surf Chat, either click the Message button on that individual\'s profile, or click the (+) button on the Chats page in order to pop-up a menu that will allow for you to search who you\'d like to chat.","sidebar":"tutorialSidebar"},"Chat/Encryption":{"id":"Chat/Encryption","title":"Encryption","description":"This feature is still under progress, but we are working on enabling chat encryption. When complete, this option will be offered in Settings in the Security page.","sidebar":"tutorialSidebar"},"Chat/What is Chat":{"id":"Chat/What is Chat","title":"Surf Chat","description":"Surf Chat is a tool that allows you to directly speak with other users on Surf in a closed and isolated space. In order to access Surf Chat, simply click the chat button at the top right of the Home Page(Mobile) or on the navigation bar(PC). You can also access it by clicking the Message button on the individual\'s profile.","sidebar":"tutorialSidebar"},"Enterprise":{"id":"Enterprise","title":"Surf Enterprise","description":"Surf Enterprise is one of the products that Surf offers, but explicitly to businesses. It allows for businesses to hold a presence on Surf, along with numerous other perks.","sidebar":"tutorialSidebar"},"Getting Started/Congrats":{"id":"Getting Started/Congrats","title":"Congrats!","description":"Congratulations! You\'re now a Surfer!","sidebar":"tutorialSidebar"},"Getting Started/Create Profile":{"id":"Getting Started/Create Profile","title":"Create your Profile","description":"Enter your information into the Name, username, Phone Number, and Bio fields.","sidebar":"tutorialSidebar"},"Getting Started/Creating Your Account":{"id":"Getting Started/Creating Your Account","title":"Creating Your Account","description":"To start, please go to the Sign up page by clicking Don\'t Have an account? Sign up here. Then, proceed to enter your email and your password. Then proceed to the next step, Email Verification.","sidebar":"tutorialSidebar"},"Getting Started/date of birth":{"id":"Getting Started/date of birth","title":"Date of Birth Policy","description":"You must be 13 and above to use Surf. Otherwise, you are in violation of our Terms of Service. On the Date of Birth page, you declare your date of birth by using the Date of Birth Field.","sidebar":"tutorialSidebar"},"Getting Started/Email Verification":{"id":"Getting Started/Email Verification","title":"Email Verification","description":"The Email Verification page serves as a checkpoint for users new to Surf, making sure that their inputted email addresses","sidebar":"tutorialSidebar"},"Getting Started/Pin":{"id":"Getting Started/Pin","title":"Pin Creation","description":"For user\'s privacy and safety across multiple devices, Surf users are required to submit a 4 digit PIN.","sidebar":"tutorialSidebar"},"intro":{"id":"intro","title":"Introduction","description":"Welcome to Surf, the next generation of Social Media.","sidebar":"tutorialSidebar"},"Notifications/Notification Types":{"id":"Notifications/Notification Types","title":"Notification Types","description":"There are three primary types of Notifications that you\'ll get","sidebar":"tutorialSidebar"},"Notifications/Notifications Page":{"id":"Notifications/Notifications Page","title":"Notifications Page","description":"The Notifications page allows you to visualize all of your notifications. At the top, it has a display showing you the different categories that make up your notifications. Below it, there\'s a section that displays all of your recent notifications with buttons to navigate to where they originated, in addition to a Mark All as Read button.","sidebar":"tutorialSidebar"},"Notifications/Silent Mode":{"id":"Notifications/Silent Mode","title":"Silent Mode","description":"Silent Mode is a feature that enables users to disable all push and email notifications from one switch. Simply go to your Surf Settings, proceed to Notifications, and click silent mode.","sidebar":"tutorialSidebar"},"Posts/Creating a Post":{"id":"Posts/Creating a Post","title":"Creating a post","description":"In order to create your post, go to the Create Post page by pressing the Plus(+) button, either at the bottom of your screen(Mobile) or the side(PC).","sidebar":"tutorialSidebar"},"Posts/Post Comments":{"id":"Posts/Post Comments","title":"Comments","description":"Users can comment on posts in order to provide their reactions or express their thoughts. In order to leave a comment, you can either click on the post to open the comments section, or, if you\'re on the Home Page on PC, you can click the Comments expansion button at the top right, which will not only allow you to see all the comments on every post, but also enable you to post a comment.","sidebar":"tutorialSidebar"},"Posts/Post Components":{"id":"Posts/Post Components","title":"Post Components","description":"When you long-press a post, the Post-Control Widget pops up. Within it, you can do the following interactions:","sidebar":"tutorialSidebar"},"Posts/What is a post":{"id":"Posts/What is a post","title":"What is a Post?","description":"A Post is a form of user-generated media within Surf. It allows you to express yourself by sharing an image as well as a caption.","sidebar":"tutorialSidebar"},"Surf Sapphire":{"id":"Surf Sapphire","title":"Surf Sapphire","description":"Surf Sapphire is one of the products that Surf offers, but explicitly to users.","sidebar":"tutorialSidebar"},"Threads/Creating a Thread":{"id":"Threads/Creating a Thread","title":"Creating a Thread","description":"In order to create your Thread, go to the Create Post page by pressing the Plus(+) button, either at the bottom of your screen(Mobile) or the side(PC). You will see two tabs. One for Posts and one for Threads. Simply swipe left or click Threads at the top to open the Threads creation tab.","sidebar":"tutorialSidebar"},"Threads/Post Components":{"id":"Threads/Post Components","title":"Thread Components","description":"When you long-press a thread, the Thread-Control Widget pops up. Within it, you can do the following interactions:","sidebar":"tutorialSidebar"},"Threads/Thread Comments":{"id":"Threads/Thread Comments","title":"Comments","description":"Users can comment on posts in order to provide their reactions or express their thoughts. In order to leave a comment, you can either click on the post to open the comments section, or, if you\'re on the Threads Page on PC, you can click the Comments expansion button at the top right, which will allow you to view the top 3 comments of the thread, along with a view more button that will allow you to view all the comments and to post your own.","sidebar":"tutorialSidebar"},"Threads/What is a Thread":{"id":"Threads/What is a Thread","title":"What is a Thread?","description":"A Thread is a form of user-generated content within Surf. It allows you to express yourself by sharing and expressing your thoughts via text.","sidebar":"tutorialSidebar"}}}')}}]);